import React from 'react'
import ReactDOM from 'react-dom'
import { MuiThemeProvider } from '@material-ui/core/styles'
import theme from './theme/theme'
import App from './app/app'

function Root(props)
{
    return(
        <MuiThemeProvider theme={theme}>
            <App />
        </MuiThemeProvider>
    )
}
